import React, { useState, useEffect } from "react";
import axios from "axios";

/* import Vehicles from "../pages/vehicles"; */

const Dropdown = (props) => {
  const [entity, setEntity] = useState([]);
  const prop1 = props.prop1;
  const prop2 = props.prop2;

  useEffect(() => {
    loadVehicles();
  }, []);

  const loadVehicles = async () => {
    const result = await axios.get(`http://localhost:5000/${props.entity}`);
    //console.log(result.data);
    //  result.data.map((item) => delete item.id);
    setEntity(result.data);
  };

  return (
    <>
      <option value="DEFAULT">Select</option>
      {props.entity.map((item, index) => (
        <option value={item.prop1}>{item.prop2}</option>
      ))}
    </>
  );
};
export default Dropdown;
